import React, { Component } from 'react';
import './Home.sass';
import { Grid, Paper } from '@material-ui/core';

const styles = ({
    root: {
        flexGrow: 1,
    },
    paper: {
        padding: theme.spacing.unit * 2,
        textAlign: 'center',
        color: theme.palette.text.secondary,
    },
});
class Home extends Component {

    render() {
        return (
            <div className={'Home-container'}>
                <Grid container spacing={24}>
                    <Grid item xs={12}>
                        <Paper styles={styles.paper}>xs=12</Paper>
                    </Grid>
                    <Grid item xs={6}>
                        <Paper styles={styles.paper}>xs=6</Paper>
                    </Grid>
                    <Grid item xs={6}>
                        <Paper styles={styles.paper}>xs=6</Paper>
                    </Grid>
                    <Grid item xs={3}>
                        <Paper styles={styles.paper}>xs=3</Paper>
                    </Grid>
                    <Grid item xs={3}>
                        <Paper styles={styles.paper}>xs=3</Paper>
                    </Grid>
                    <Grid item xs={3}>
                        <Paper styles={styles.paper}>xs=3</Paper>
                    </Grid>
                    <Grid item xs={3}>
                        <Paper styles={styles.paper}>xs=3</Paper>
                    </Grid>
                </Grid>
            </div>
        );
    }
}
export default Home;
